import React, { Component } from "react";
import {BrowserRouter, Switch, Route} from "react-router-dom";
import Customers from "./components/Customers"
import Medicines from "./components/Medicines"
import SearchMedicines from "./components/SearchMedicines";
import MedicineOrders from "./components/MedicineOrders";
import AddMedicineOrder from "./components/AddMedicineOrder";
import Dashboard  from "./components/Dashboard";
import './App.css';



class App extends Component {

    render(){
        return(
            <BrowserRouter>
                <Switch>
                    <Route exact path="/">
                        <Dashboard/>
                    </Route>
                    <Route exact path="/customers">
                        <Customers/>
                    </Route>
                    <Route exact path="/medicines">
                        <Medicines/>
                    </Route>
                    <Route exact path="/searchMedicines">
                        <SearchMedicines/>
                    </Route>
                    <Route exact path="/medicineOrders">
                        <MedicineOrders/>
                    </Route>
                    <Route exact path="/newMedicineOrder">
                        <AddMedicineOrder/>
                    </Route>
                </Switch>
            </BrowserRouter>
        );
    }

}

export default App;
